import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import Login from "./Login";
import Register from "./Register";
import Profile from "./Profile";
import TeenPattiApp from "./TeenPattiApp";
import RoomTest from "./RoomTest";

function App() {
  return (
    <BrowserRouter>
      <div className="min-h-screen flex items-center justify-center bg-gray-100">
        <nav className="absolute top-4 right-4 space-x-4">
          <Link to="/login" className="text-blue-600 hover:underline">Login</Link>
          <Link to="/" className="text-blue-600 hover:underline">Register</Link>
          <Link to="/pro" className="text-blue-600 hover:underline">Profile</Link>
          <Link to="/game" className="text-blue-600 hover:underline">Game</Link>
          <Link to="/room" className="text-blue-600 hover:underline">GameTest</Link>
        </nav>

        <Routes>

          <Route path="/Room" element={<RoomC />} />
          <Route path="/login" element={<Login />} />
          <Route path="/" element={<Register />} />
           <Route path="/pro" element={<Profile />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
